//Display numbers between 1 to 20.If the number is two digit number then display stop the process
package com.loops;
public class Display2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 
		for(int i=1;i<=20;i++)
		{
			  
			 if(i>=10)
			 {
			    break;
			 }
			 System.out.println(i);
		}

	}

}
